    row: {
      flex: 1,
      alignItems: 'center',
      justifyContent: 'center',
      width: '100%',
      height:'100%',
      flexDirection: 'row',
    },
    post:{
      height:'100%',
      alignItems:'center',
      justifyContent:'center',
      width:'50%',
      borderColor: colors.black,
      borderWidth: normalize(5)
    }
  });

export default styles
